import './App.css';
import { Router, Routes, Route } from 'react-router-dom';
import Home from './components/Home'

function App() {
  return (

    <Router>
    <Switch>
      <Route path="/" exact>
        <LandingNavbar />
        <HomePage />
      </Route>
      <Route path="/other">
        <OtherNavbar />
        <OtherPage />
      </Route>
      {/* Add more routes as needed */}
    </Switch>
  </Router>

  );

}

export default App;
